import axios from 'axios';
export const onFocus=()=>({
	type:'onfocus'
})

export const onBlur=()=>({
	type:'onblur'
})
export const getList=()=>{
	return ()=>{
		axios.get('api/list.json')
			.then((res)=>{
				console.log(res.data.data);
			})
			.catch((err)=>{
				console.log(err);
			})
	}
}
